question_text:
What is the output of the following C code? 
int i = 5; 
printf("%d %d %d", i++, i++, i++);

What will be the output? 
#include <stdio.h>
int main() {
  int x = 10, y = 20;
  if (x = y) printf("Equal");
  else printf("Not Equal");
  return 0;
}

What will be the output? 
#include <stdio.h>
int main() {
  int a[] = {1, 2, 3};
  int *p = a;
  printf("%d", *(p+1));
  return 0;
}

What will the following code print? 
int main() {
  int x = 5;
  if (x < 10)
    if (x > 5)
      printf("A");
    else
      printf("B");
  return 0;
}

Predict the output: 
#include <stdio.h>
int main() {
  int x = 0;
  for (; x < 3; x++) ;
  printf("%d", x);
  return 0;
}

Output of: 
int a = 10; 
void f() { int a = 20; } 
int main() { f(); printf("%d", a); return 0; }

What is the output? 
#include <stdio.h>
int main() {
  char *ptr = "Placement";
  printf("%c", *&*ptr);
  return 0;
}
